First part: Calculate the speed of the 2nd fastest car knowing it's 5 times faster than the average which travels at 120 mph. This would make the 2nd fastest car capable of reaching 120*5=<<120*5=600>>600 mph.
Second part: Determine the speed of the fastest car being said to be '1.25 times faster'. To achieve this we simply take our previous value (the speed of the 2nd fastest) i.e., 600 mph ,and scale it further as follows: 600*1.25 equals <<600*1.25=750>>750 mph.. Thus concluding that if both vehicles operated under ideal conditions without any limitations or environmental interference such factors could theoretically allow them to reach those respective peak speeds calculated above. As always remember though reality often introduces complexities not considered herein but still fascinating nonetheless!.
